import placeholderImage from "../../Assets/imagePlaceholder.png";
import '../../Pages/Home/Home.css';
import './Banner.css';

function Banner(){
    return <div className="BannerSection">
        <img className="placeHolder" src={placeholderImage} alt="placeHolderImage"></img>
    </div>
}

export default Banner;
